<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Dhanush, Will you be my Valentine?</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Arial', sans-serif;
            overflow: hidden;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        /* Falling hearts background */
        .heart {
            position: fixed;
            width: 20px;
            height: 20px;
            background: #ff6b9d;
            opacity: 0.8;
            z-index: 1;
            pointer-events: none;
        }

        .heart::before,
        .heart::after {
            content: '';
            position: absolute;
            width: 20px;
            height: 32px;
            background: #ff6b9d;
            border-radius: 20px 20px 0 0;
            left: -10px;
        }

        .heart::after {
            left: 0;
        }

        @keyframes fall {
            to {
                transform: translateY(100vh) rotate(360deg);
                opacity: 0;
            }
        }

        .heart.falling {
            animation: fall linear infinite;
        }

        /* Main container */
        .container {
            text-align: center;
            background: rgba(255, 255, 255, 0.95);
            padding: 60px 40px;
            border-radius: 20px;
            box-shadow: 0 20px 60px rgba(0, 0, 0, 0.3);
            max-width: 600px;
            z-index: 10;
            position: relative;
            animation: slideIn 0.8s ease-out;
        }

        @keyframes slideIn {
            from {
                opacity: 0;
                transform: translateY(-30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .gif-container {
            height: 250px;
            margin-bottom: 30px;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .gif-image {
            max-width: 100%;
            max-height: 100%;
            border-radius: 15px;
        }

        .question-text {
            font-size: 32px;
            color: #ff6b9d;
            margin-bottom: 40px;
            font-weight: bold;
        }

        .button-container {
            display: flex;
            gap: 20px;
            justify-content: center;
            margin-bottom: 20px;
            flex-wrap: wrap;
        }

        button {
            padding: 15px 40px;
            font-size: 18px;
            border: none;
            border-radius: 10px;
            cursor: pointer;
            font-weight: bold;
            transition: all 0.3s ease;
            position: relative;
        }

        .yes-btn {
            background: linear-gradient(135deg, #ff6b9d, #ff8fab);
            color: white;
            min-width: 120px;
            font-size: 18px;
        }

        .yes-btn:hover {
            box-shadow: 0 10px 25px rgba(255, 107, 157, 0.4);
        }

        .no-btn {
            background: #ddd;
            color: #333;
            min-width: 120px;
        }

        .no-btn:hover {
            background: #ccc;
        }

        /* Success page */
        .success-page {
            display: none;
            animation: fadeIn 0.8s ease-out;
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
            }
            to {
                opacity: 1;
            }
        }

        .success-page.show {
            display: block;
        }

        .fireworks {
            position: fixed;
            width: 10px;
            height: 10px;
            background: #ff6b9d;
            border-radius: 50%;
            pointer-events: none;
            z-index: 2;
        }

        @keyframes explode {
            to {
                transform: translate(var(--tx), var(--ty)) scale(0);
                opacity: 0;
            }
        }

        .fireworks.explode {
            animation: explode 0.8s ease-out forwards;
        }

        .big-heart {
            font-size: 100px;
            margin-bottom: 20px;
            animation: bounce 0.6s ease-in-out infinite;
        }

        @keyframes bounce {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.2); }
        }

        .success-message {
            font-size: 32px;
            color: #ff6b9d;
            margin-bottom: 30px;
            font-weight: bold;
        }

        .confetti {
            position: fixed;
            width: 10px;
            height: 10px;
            background: #ff6b9d;
            pointer-events: none;
            z-index: 2;
        }

        @keyframes confetti-fall {
            to {
                transform: translateY(100vh) rotate(720deg);
                opacity: 0;
            }
        }

        .confetti.falling {
            animation: confetti-fall 2.5s ease-in forwards;
        }

        .grow-text {
            font-size: 16px;
            color: #999;
            margin-top: 20px;
            font-style: italic;
        }
    </style>
</head>

    <!-- Main page -->
    <div class="container" id="mainPage">
        <div class="gif-container">
            <img class="gif-image" id="mainGif" src="" alt="Bubu with rose">
        </div>
        
        <div class="question-text">Dhanush, Will you be my Valentine?</div>
        
        <div class="button-container">
            <button class="yes-btn" id="yesBtn" onclick="handleYes()">YES! ðŸ’•</button>
            <button class="no-btn" id="noBtn" onclick="handleNo()">No</button>
        </div>
        
    </div>

    <!-- Success page -->
    <div class="success-page" id="successPage">
        <div class="gif-container">

        <div class="success-message">I Knew it !! I LOVE YOUUU NANNULUUUUUUðŸ˜˜ðŸ˜˜</div>

        // Create confetti effect
        function createConfetti() {
            for (let i = 0; i < 50; i++) {
                setTimeout(() => {
                    const confetti = document.createElement('div');
                    confetti.className = 'confetti falling';
                    confetti.style.left = Math.random() * window.innerWidth + 'px';
                    confetti.style.top = '-10px';
                    confetti.style.background = ['#ff6b9d', '#667eea', '#ff8fab', '#ffd700'][Math.floor(Math.random() * 4)];
                    confetti.style.animationDuration = (Math.random() * 1 + 2) + 's';
                    document.body.appendChild(confetti);

                    setTimeout(() => confetti.remove(), 3000);
                }, i * 30);
            }
        }

        function handleYes() {
    // Hide main page
    document.getElementById('mainPage').style.display = 'none';

    // Show success page
    const successPage = document.getElementById('successPage');
    successPage.classList.add('show');

    // Create confetti and fireworks
    createConfetti();
    createFireworks();
}


        // Create fireworks effect
        function createFireworks() {
            for (let burst = 0; burst < 8; burst++) {
                setTimeout(() => {
                    const centerX = window.innerWidth / 2;
                    const centerY = window.innerHeight / 2;

                    for (let i = 0; i < 20; i++) {
                        const firework = document.createElement('div');
                        firework.className = 'fireworks explode';
                        firework.style.left = centerX + 'px';
                        firework.style.top = centerY + 'px';

                        const angle = (i / 20) * Math.PI * 2;
                        const distance = 150;
                        const tx = Math.cos(angle) * distance;
                        const ty = Math.sin(angle) * distance;

                        firework.style.setProperty('--tx', tx + 'px');
                        firework.style.setProperty('--ty', ty + 'px');
                        firework.style.background = ['#ff6b9d', '#ffd700', '#ff8fab'][Math.floor(Math.random() * 3)];

                        document.body.appendChild(firework);
                        setTimeout(() => firework.remove(), 1000);
                    }
                }, burst * 150);
            }
        }
    </script>
